import React from 'react';
import CardMedia from '@mui/material/CardMedia';
import Card from '@mui/material/Card';
import Typography from '@mui/material/Typography';
import Button from '@mui/material/Button';
import styles from './Hero.module.scss';

const Hero = () => {
  return (
    <div className={styles.hero}>
      <Card>
        <CardMedia
          component="div"
          className={styles.videoBackground}
        >
          <video autoPlay loop muted playsInline className={styles.video}>
            <source src={require('../../assets/videos/video1.mp4').default} type="video/mp4" />
            Seu navegador não suporta a tag de vídeo.
          </video>
        </CardMedia>
        <div className={styles.content}>
          <Typography variant="h5" component="div">
            Serras para alto desempenho
          </Typography>
          <Typography variant="body1" component="div">
            Conheça nossos produtos e serviços de alta qualidade.
          </Typography>
          <div className={styles.buttonContainer}>
            <Button variant="contained" color="primary">Nossos produtos</Button>
            <Button variant="outlined" color="primary">Fale conosco</Button>
          </div>
        </div>
      </Card>
    </div>
  );
};

export default Hero;
